def solve():
    lines = [line.strip() for line in stabilizers_str.split('\n') if line.strip()]
    
    # Verify all lengths
    for i, line in enumerate(lines):
        if len(line) == 184:
            lines[i] = line + "II"
            print(f"Fixed length of stabilizer {i} by appending 'II'")
        
        if len(lines[i]) != 186:
            print(f"Error: Stabilizer {i} has length {len(lines[i])}")
            return

    stabilizers = [stim.PauliString(line) for line in lines]
    
    # Verify commutativity
    bad_pairs = []
    for i in range(len(stabilizers)):
        for j in range(i+1, len(stabilizers)):
            if not stabilizers[i].commutes(stabilizers[j]):
                bad_pairs.append((i, j))
    
    if bad_pairs:
        print(f"Anticommutes: {len(bad_pairs)}")
        for i, j in bad_pairs[:5]:
            print(f"  {i} vs {j}")
        return

    # Solve
    try:
        tableau = stim.Tableau.from_stabilizers(stabilizers, allow_underconstrained=True, allow_redundant=True)
        circuit = tableau.to_circuit(method="elimination")
        
        # Save to file
        filename = "circuit_186.stim"
        with open(filename, "w") as f:
            f.write(str(circuit))
        print(f"Circuit generated in {filename}.")
        
    except Exception as e:
        print(f"Error: {e}")

if __name__ == "__main__":
    solve()
